import React from 'react';
import Ordertable from '../PageContent/Ordertable';

function Orders() {
  return (
    <div className='App'>
      <Toolbar />
      <div className='main-manue'>
        <div><h2>Order History</h2></div>
        <Ordertable />
      </div>     
    </div>
  )
}

export default Orders
